import React, { useState, useEffect, useRef } from "react";
import axios from "axios";

const Insert = () => {
    // State to hold data from the server
    const [tableData, setTableData] = useState([]);
    
    // Form refs
    const txtname = useRef();
    const txtemail = useRef();
    const txtpassword = useRef();
    
    // Load initial data when component mounts
    useEffect(() => {
        fetchData();
    }, []);
    
    // Function to fetch data from server
    const fetchData = () => {
        axios.get('https://geton.skmbpk1z.a2hosted.com/get-data.php')
            .then(response => {
                setTableData(response.data);
            })
            .catch(error => {
                console.error("Error fetching data:", error);
            });
    };
    
    // Handle form submission
    const handlesubmit = (e) => {
        e.preventDefault();
        
        var name = txtname.current.value;
        var email = txtemail.current.value;
        var password = txtpassword.current.value;
        
        var a = new FormData();
        a.set('name', name);
        a.set('email', email);
        a.set('password', password);
        
        axios.post('https://geton.skmbpk1z.a2hosted.com/insert-data.php', a)
            .then(function(response) {
                // Clear form fields
                txtname.current.value = '';
                txtemail.current.value = '';
                txtpassword.current.value = '';
                
                // Fetch updated data from server
                fetchData();
            })
            .catch(error => {
                console.error("Error submitting data:", error);
            });
    };
    
    return (
        <>
            {/* Form for submitting data */}
            <form method="post" onSubmit={handlesubmit}>
                <table border={1} cellPadding={7} cellSpacing={0.1}>
                    <tbody>
                        <tr>
                            <td>Name</td>
                            <td><input type="text" ref={txtname}/></td>
                        </tr>
                        <tr>
                            <td>Email</td>
                            <td><input type="text" ref={txtemail}/></td>
                        </tr>
                        <tr>
                            <td>Password</td>
                            <td><input type="text" ref={txtpassword}/></td>
                        </tr>
                        <tr>
                            <td>
                                <input type="submit" value={'submit'}/>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </form>
            
            {/* Table to display data */}
            <h3>User Data</h3>
            <table border={1} cellPadding={7} cellSpacing={0.1}>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Password</th>
                    </tr>
                </thead>
                <tbody>
                    {tableData.map((item) => (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.name}</td>
                            <td>{item.email}</td>
                            <td>{item.password}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </>
    );
};

export default Insert;
